import React from 'react';

const Home = () => (
  <main style={{
    backgroundImage: "url('https://source.unsplash.com/1600x900/?technology,dark,software')",
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '40px',
  }}>
    <h1 style={{
      fontSize: '2.75rem',
      fontWeight: '700',
      color: '#ffffff',
      textAlign: 'center',
      backgroundColor: 'rgba(0, 0, 0, 0.5)',
      padding: '20px 30px',
      borderRadius: '10px',
    }}>
      <h1>Transforming Ideas into Digital Reality</h1>
      <p> Custom Software Development Across<br />
          Multiple Technologies</p>
      <p>At Millennial, we craft modern web solutions with cutting-edge technology to bring your vision to life.</p>
    </h1>
  </main>
);

export default Home;
